# frozen_string_literal: true

EVENT_LOG ||= Logger.new(Rails.root.join('log', 'event.log'))

module Resources
  class Kartalytics < Grape::API
    format :json

    params do
      requires :events, type: Array
    end

    post '/ingest' do
      params[:events].each do |event|
        EVENT_LOG.info event.to_json
        KartalyticsState.ingest(event)
      end
      status :ok
    end

    get '/event' do
      if !Rails.env.development? || ENV['KARTALYTICS_EVENT_STUB'].nil?
        Entities::Kartalytics::Event.new(true)
      else
        Kartalytics.event_stub
      end
    end

    get '/event_select_players' do
      Entities::Kartalytics::EventSelectPlayers.new(true)
    end

    get '/matches' do
      matches = KartalyticsMatch.finished.with_players.paginate(:page => params[:page]).order('created_at DESC')

      present :matches, matches, with: Entities::Kartalytics::Match
      present :current_match, KartalyticsMatch.current_match, with: Entities::Kartalytics::Match
    end

    params { requires :match_id }
    get '/match/:match_id' do
      present KartalyticsMatch.find(params[:match_id]), with: Entities::Kartalytics::ComplexMatch
    end

    params { requires :race_id }
    get '/race_update/:race_id' do
      KartalyticsRace.find(params[:race_id]).to_chart_json
    end

    get '/leaderboard' do
      present TrueskillLeaderboard.new(League.id_for('kart'), 1.month.ago).latest, with: Entities::Kartalytics::Player
    end

    get '/players' do
      present ::Player.all.order(:name), with: Entities::Kartalytics::Player
    end

    get '/courses' do
      present ::KartalyticsCourse.all.order(:name), with: Entities::Kartalytics::Course
    end

    params { requires :name }
    get '/courses/:name' do
      present ::KartalyticsCourse.find_by(name: params[:name]), with: Entities::Kartalytics::ComplexCourse
    end

    params { requires :name }
    get '/players/:name' do
      present ::Player.find_by(name: params[:name]), with: Entities::Kartalytics::ComplexPlayer
    end

    put '/double-down/' do
      previous_match = KartalyticsMatch.second_to_last
      current_match = KartalyticsMatch.last

      current_match.associate_players!(
        player_one: previous_match.player_one,
        player_two: previous_match.player_two,
        player_three: previous_match.player_three,
        player_four: previous_match.player_four,
      )
    end

